import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
//передаем данные из вне в наше приложение
let usersData = [
    {id:1,name: "Andrey"},
    {id:2,name: "Alexandr"},
    {id:3,name: "Darya"},
    {id:4,name: "Ivan"},
]
let messageData = [
    {id:1,message: "Hello"},
    {id:2,message: "How are you, man?"},
    {id:3,message: "What interestind in your life?"},
    {id:4,message: "I'm glad to hear you!"},
]
let postsData = [
    {id:1,text: "Hello", like:12},
    {id:2,text: "How are you, man?",like:11},
    {id:3,text: "What interestind in your life?",like:1},
    {id:4,text: "I'm glad to hear you!",like: 5},
]
// обьявляем приложение
ReactDOM.render(<App messageData={messageData} usersData={usersData} postsData={postsData}/>, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: http://bit.ly/CRA-PWA
serviceWorker.unregister();
